import React, { useState } from "react";
import ContactInfo from "../components/ContactInfo";
import PetInfoForm from "../components/PetInfoForm";
import TileList from "../components/TileList";

const PetInfoPage = () => {
    const [contacts, setContacts] = useState([]);
    const [pets, setPets] = useState([]);

    const handleContactSubmit = (contactData) => {
        setContacts((prevContacts) => [...prevContacts, contactData]);
    };

    const handlePetSubmit = (petData) => {
        setPets((prevPets) => [...prevPets, petData]);
    };

    return (
        <div>
        <h1>Contact Information</h1>
        <ContactInfo handleSubmit={handleContactSubmit} />
        <h1>Pet Information</h1>
        <PetInfoForm contacts={contacts} handleSubmit={handlePetSubmit} />
        <h1>Pet Info Section</h1>
        <TileList contacts={contacts} pets={pets} />
        </div>
    );
};

export default PetInfoPage;
